fn jump_search<T: Ord>(arr: &[T], target: T) -> Option<usize> { let length = arr.len(); let jump = (length as f64).sqrt() as usize; let mut prev = 0; let mut curr = 0; while curr < length && arr[curr] < target { prev = curr; curr = (curr + jump).min(length - 1); } for i in prev..=curr { if arr[i] == target { return Some(i); } } None
