The Fibonacci sequence is a classic example to illustrate Dynamic Programming. Each number in the sequence is the sum of the two preceding ones. The problem can be solved using both memoization and tabulation. Recursive Solution (Naive Approach) fn fibonacci(n: u32) -> u32 { match n { 0 => 0, 1 => 1, _ => fibonacci(n - 1) + fibonacci(n - 2), }
} fn main() { let n = 10; println!("Fibonacci of {} is {}", n, fibonacci(n));
} Memoization Approach use std::collections::HashMap; fn fibonacci_memo(n: u32, memo: &mut HashMap<u32, u32>) -> u32 { if let Some(&result) = memo.get(&n) { return result; } let result = match n { 0 => 0, 1 => 1, _ => fibonacci_memo(n - 1, memo) + fibonacci_memo(n - 2, memo), }; memo.insert(n, result); result
} fn main() { let n = 10; let mut memo = HashMap::new(); println!("Fibonacci of {} is {}", n, fibonacci_memo(n, &mut memo));
} Tabulation Approach fn fibonacci_tab(n: u32) -> u32 { if n == 0 { return 0; } else if n == 1 { return 1; } let mut table = vec![0; (n + 1) as usize]; table[1] = 1; for i in 2..=n { table[i as usize] = table[(i - 1) as usize] + table[(i - 2) as usize]; } table[n as usize]
} fn main() { let n = 10; println!("Fibonacci of {} is {}", n, fibonacci_tab(n));
}

