The Knapsack Problem is a classic optimization problem where you must determine the most valuable combination of items to include in a knapsack without exceeding its capacity. Problem Definition Given weights and values of items, and a knapsack capacity, find the maximum value that can be obtained by picking items to fit into the knapsack. Tabulation Approach fn knapsack(weights: &[usize], values: &[usize], capacity: usize) -> usize { let n = weights.len(); let mut dp = vec![0; capacity + 1]; for i in 0..n { for w in (weights[i]..=capacity).rev() { dp[w] = dp[w].max(dp[w - weights[i]] + values[i]); } } dp[capacity]
} fn main() { let weights = vec![1, 2, 3]; let values = vec![10, 15, 40]; let capacity = 6; println!("Maximum value in knapsack: {}", knapsack(&weights, &values, capacity));
}

