The N-Queens problem involves placing N queens on an N x N chessboard so that no two queens threaten each other. The challenge is to find all possible arrangements. Rust Implementation fn is_safe(board: &Vec<Vec<bool>>, row: usize, col: usize) -> bool { // Check this column on previous rows for i in 0..row { if board[i][col] { return false; } } // Check upper-left diagonal let mut i = row; let mut j = col; while i >= 0 && j >= 0 { if board[i][j] { return false; } if i == 0 || j == 0 { break; } i -= 1; j -= 1; } // Check upper-right diagonal i = row; j = col; while i >= 0 && j < board.len() { if board[i][j] { return false; } if i == 0 || j == board.len() - 1 { break; } i -= 1; j += 1; } true
} fn solve_n_queens(board: &mut Vec<Vec<bool>>, row: usize) -> bool { if row >= board.len() { return true; } for col in 0..board.len() { if is_safe(board, row, col) { board[row][col] = true; if solve_n_queens(board, row + 1) { return true; } board[row][col] = false; } } false
} fn main() { let n = 4; let mut board = vec![vec![false; n]; n]; if solve_n_queens(&mut board, 0) { println!("Solution found:"); for row in board { for cell in row { if cell { print!("Q "); } else { print!(". "); } } println!(); } } else { println!("No solution found."); }
}

