} impl<T: Ord> BSTNode<T> { fn new(value: T) -> Self { BSTNode { value, left: None, right: None, } } fn insert(&mut self, value: T) { if value < self.value { if let Some(left) = &mut self.left { left.insert(value); } else { self.left = Some(Box::new(BSTNode::new(value))); } } else { if let Some(right) = &mut self.right { right.insert(value); } else { self.right = Some(Box::new(BSTNode::new(value))); } } } fn search(&self, value: T) -> bool { if value == self.value { true } else if value < self.value { self.left.as_ref().map_or(false, |node| node.search(value)) } else { self.right.as_ref().map_or(false, |node| node.search(value)) } }
} fn main() { let mut bst = BSTNode::new(10); bst.insert(5); bst.insert(15); bst.insert(7); println!("BST Search 7: {}", bst.search(7)); println!("BST Search 20: {}", bst.search(20));
}

