Here’s a basic implementation of a max-heap in Rust using a vector: #[derive(Debug)]
struct MaxHeap<T> { heap: Vec<T>,
} impl<T: Ord> MaxHeap<T> { fn new() -> Self { MaxHeap { heap: Vec::new() } } fn insert(&mut self, value: T) { self.heap.push(value); self.heapify_up(self.heap.len() - 1); } fn extract_max(&mut self) -> Option<T> { if self.heap.is_empty() { return None; } let max = self.heap.swap_remove(0); self.heapify_down(0); Some(max) } fn heapify_up(&mut self, index: usize) { let mut child = index; while child > 0 { let parent = (child - 1) / 2; if self.heap[child] <= self.heap[parent] { break; } self.heap.swap(child, parent); child = parent; } } fn heapify_down(&mut self, index: usize) { let mut parent = index; let len = self.heap.len(); loop { let mut max = parent; let left = 2 * parent + 1; let right = 2 * parent + 2; if left < len && self.heap[left] > self.heap[max] { max = left; } if right < len && self.heap[right] > self.heap[max] { max = right; } if max == parent { break; } self.heap.swap(parent, max); parent = max; } }
} fn main() { let mut max_heap = MaxHeap::new(); max_heap.insert(10); max_heap.insert(20); max_heap.insert(5); println!("Max Heap: {:?}", max_heap); while let Some(max) = max_heap.extract_max() { println!("Extracted Max: {}", max); }
}

