Here's an implementation of a priority queue using a max-heap in Rust: #[derive(Debug)]
struct PriorityQueue<T> { heap: MaxHeap<T>,
} impl<T: Ord> PriorityQueue<T> { fn new() -> Self { PriorityQueue { heap: MaxHeap::new(), } } fn enqueue(&mut self, value: T) { self.heap.insert(value); } fn dequeue(&mut self) -> Option<T> { self.heap.extract_max() } fn peek(&self) -> Option<&T> { self.heap.heap.first() }
} fn main() { let mut pq = PriorityQueue::new(); pq.enqueue(30); pq.enqueue(10); pq.enqueue(20); println!("Priority Queue: {:?}", pq); while let Some(max) = pq.dequeue() { println!("Dequeued: {}", max); }
}
